import React from 'react';
import Sketchfab from 'sketchfab';
import {Link} from 'react-router-dom';

import '../../Style/Portfolio.css';

class Project12 extends React.Component {
    render(){

        var iframe = document.getElementById( 'api-frame' );

        var version = '1.0.0';

        var urlid = 'e9e66978d4a248e2b0c4fdbb9912a573';

        var client = new Sketchfab( version, iframe );

        client.init( urlid, {
            // API is ready to use. You can interact with the viewer using the api object passed to the success function
            success: function onSuccess( api ){
                // Start the viewer immediately
                api.start();
            },
            // If initialization fails, throw an error
            error: function onError() {
                console.log( 'Viewer error' );
            }
        } );

        return(
            <div className= "portfolio-panel" id = "portfolio">
                <div className= "container">
                    <div className= "orange-stripe"></div>
                    <h1 className= "portfolio-heading">Portfolio</h1>
                    <h5 className= "my-work">My Work</h5>
                </div>

                <div className= "container">
                    <iframe src="" id="api-frame" allowFullScreen mozallowfullscreen="true" webkitallowfullscreen="true"
                            width="400px" height="300px"></iframe>
                </div>
            </div>
        )
    }
}

export default Project12;
